Static variables are those variables that retain their values between different function calls. Static variables are initialized only once at compile time and they have internal linkage. Static variables can be either global or local.
Register variables are those variables that the programmer suggests to the compiler to store in a register of the CPU. The compiler may or may not follow this suggestion. The register variables have auto storage class and they are initialized to garbage value if not initialized explicitly.
Here is an example of static and register variables in C:
```
#include <stdio.h>

void fun() {
    static int i = 10; // static variable
    register int j = 20; // register variable
    i++;
    j++;
    printf("i = %d, j = %d\n", i, j);
}

int main() {
    fun();
    fun();
    return 0;
}
```
In this example, the variable `i` is a static variable and it retains its value between different function calls. The variable `j` is a register variable and it is initialized to 20. The output of this program will be:
```
i = 11, j = 21
i = 12, j = 21
```
As you can see, the value of `i` is retained between function calls, but the value of `j` is not. This is because `i` is a static variable and `j` is a register variable.

Note that the `register` keyword is only a suggestion to the compiler, and the compiler may not always follow it. In modern compilers, the `register` keyword is often ignored,

