function sortAlphanumerically(arr, key) {
  return arr.sort((a, b) => {
    const aVal = a[key];
    const bVal = b[key];
    const aNum = aVal.replace(/[^0-9]/g, '');
    const bNum = bVal.replace(/[^0-9]/g, '');
    if (aNum === '' && bNum === '') {
      return aVal.localeCompare(bVal);
    } else if (aNum === '') {
      return -1;
    } else if (bNum === '') {
      return 1;
    } else {
